searchData={"items":[{"type":"module","title":"Coreelixir","doc":"Documentation for `Coreelixir`.","ref":"Coreelixir.html"},{"type":"function","title":"Coreelixir.hello/0","doc":"Hello world.","ref":"Coreelixir.html#hello/0"},{"type":"function","title":"Examples - Coreelixir.hello/0","doc":"iex> Coreelixir.hello()\n    :world","ref":"Coreelixir.html#hello/0-examples"},{"type":"module","title":"Myvariable","doc":"Elixir is a dynamic lang, you dont explicitly declare variable type\n  the variable type is determined by whatever data it contains at the moment\n  in elixir the assignment is called binding\n  when you initialize a variable with a value, the variable is bound to that value\n\n  In Elixir, a variable name always starts with a lowercase alphabetic character or an underscore.\n  After that, any combination of alphanumerics and underscores is allowed.\n  The prevalent convention is to use only lowercase letters, digits, and underscores:\n\n  Each expression in Elixir has a result\n\n  Data in Elixir is immutable: its contents can’t be changed. But variables can be\n  rebound to a different value:","ref":"Myvariable.html"},{"type":"module","title":"example - Myvariable","doc":"iex(5)> monthly_salary = 1000\n     1000\n     iex(6)> monthly_salary\n     1000\n     iex(8)> monthly_salary = 3000\n     iex(9)> monthly_salary\n     3000\n\n\n  You should always be aware of the fact that data is immutable.\n  Once a memory location is occupied with data, it can’t be modified until it’s released.\n  But variables can be rebound, which makes them point to a different memory location.\n  Thus variables are mutable, whereas the data they point to is immutable.","ref":"Myvariable.html#module-example"},{"type":"function","title":"Myvariable.salario/0","doc":"","ref":"Myvariable.html#salario/0"}],"content_type":"text/markdown"}